  JWILLIAMS, Francis James Volkner (Frank) and STANDISH, Edith Frances
  JWILLIAMS, Bevan Sydney and WILLIAMS, Mary Margaret Wilder (Bettie)
  JWILLIAMS, Caroline Margaret and INGLE, Michael Peter
  03> INGLE, Henrietta Mary
  b 29.11.1972
  Henrietta b, at Haslemere, Surrey, England. She was educated at St Mary's,
  Shaftesbury, and St Catherine's, Bramley, then graduated from University College,
  London, with BSc (Hons) in Psychology. She now works as a management consultant for
  Andersen Consulting. She enjoys travel and had toured through much of Europe and
  Asia.
  05> WILLIAMS, Francis James Nigel m on 03.02.1967 to PEARSON, Fiona Campbell
  b 29.05.1942
  b 15.12.1945
  Nigel b. at Napier and m. at St John's Church, Trentham. Divorced 1988. Fiona, d/o Archdeacon Tom
  Vivian Pearson and Ngara Scott Mackay, b. at Wellington, Address: "Foxhollow", 8 Waiwhero Street,
  Rotorua.
  Nigel was educated at Christ's College and Victoria University (BSc Botany) then went on to gain an
  honours degree in forestry from Bangor, North Wales. He was then a forester with the Forest Service at
  Bulls, the Forestry Training Centre at Rotorua and Kaingaroa. Since 1979 he has been with the Forest
  Research Institute at Rotorua where he is Software Manager and Research Cooperative Manager.
  Fiona was educated at Marsden School and Victoria University (BA in Education and Psychology and later
  MA in Social Work). She has had extensive (psychiatric) social work experience in Wellington (Child
  Welfare, Hutt Hospital) and Rotorua (Social Security and Hospital). She is Support Services Coordinator
  with the Wellington Cancer Society.
  01> WILLIAMS, Michael Thomas
  b 19.02.1969
  Michael b. at Bangor, North Wales,
  Michael was educated at Edmund Rice College, Rotorua, Wellington High School and Victoria
  University (BSc in Computer Science). He has since worked in Auckland and Wellington and is
  currently in London.
  02> WILLIAMS, Emma Louise
  b 09.01.1972
  Emma b. at Marton. She was educated at Wellington High School and graduated BSc in Plant Science
  from Canterbury University. She has since worked with the Office of the Film and Literature
  Classification Authority and is currently with the New Zealand Embassy in Washington, DC.
  02>' WILLIAMS, Alden William
  b 26.09.1905 d 21.01.1916
  Alden b. at Waipare, Anaura Bay, d. at Gisborne and bd. at Waipare.
  03> WILLIAMS, Janet Challis
  b 31.03.1909 d 28.11.1979
  Janet b. at Napier and d, in the Erebus crash. Jane lived for many years in Hastings as a
  companion to her mother and took a warm and lively interest in the younger members of her
  family. She and was an active member and supporter of the Hastings Branch of the NZ Red
  Cross.
